import React from 'react';

function Law(props) {
    return(
        <div>
            {props.law.map((oneLaw) => (
                <div class="card">
                    <div class="card-body">
                        <h5 class="card-title">{oneLaw.title_fi}</h5>
                        <p class="card-text">{oneLaw.content_fi}</p>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default Law;
